import { createDrawerNavigator } from "@react-navigation/drawer";
import { NavigationContainer } from "@react-navigation/native";
import { Button, View } from "react-native";
import { Button as PaperButton } from "react-native-paper"; // 导入 Button 组件
import MessagesScreen from './MessagesScreen.js';
import NewScreen from './WeatherScreen.js';
import MoodScreen from './MoodScreen.js';

function HomeScreen({ navigation }) {
  return (
    <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
      <Button onPress={navigation.openDrawer} title="Open navigation drawer" />
      <Button.Group style={{ marginTop: 10 }}>
        <PaperButton onPress={() => navigation.navigate('Message to Fife Rabbits')}>
          Message to Fife Rabbits
        </PaperButton>
        <PaperButton onPress={() => navigation.navigate('Environment')}>
          Check the Fife environment
        </PaperButton>
        <PaperButton onPress={() => navigation.navigate('Mood Color')}>
          Send you color of moods
        </PaperButton>
      </Button.Group>
    </View>
  );
}

const Drawer = createDrawerNavigator();

export default function App() {
  return (
    <NavigationContainer>
      <Drawer.Navigator initialRouteName="Home">
        <Drawer.Screen name="Home" component={HomeScreen} />
        <Drawer.Screen name="Message to Fife Rabbits" component={MessagesScreen} />
        <Drawer.Screen name="Mood Color" component={MoodScreen} />
        <Drawer.Screen name="Environment" component={NewScreen} />
      </Drawer.Navigator>
    </NavigationContainer>
  );
}
